-- DSMDB_Patch4
-- CHANGE THE PATCH NUMBER TO THE NEXT NEW ONE AFTER THOSE STORED IN DSM REPO

USE data_sharing_manager;

DROP PROCEDURE IF EXISTS RunPatchIfNotRunAlready;

DELIMITER //
CREATE PROCEDURE RunPatchIfNotRunAlready()
BEGIN
    -- (CHANGE THE PATCH NUMBER TO THE NEXT NEW ONE AFTER THOSE STORED IN DSM REPO, CHANGE IT BELOW HERE)
    IF ((SELECT date_time_run FROM data_sharing_manager.patch_history WHERE patch_name = 'DSMDB_Patch4') IS NULL)

    THEN
        -- ADD YOUR PATCH PROCEDURE CALL(S) HERE
        CALL CreateValueSetsTables();
        CALL AddValueSetsData();

        INSERT INTO data_sharing_manager.patch_history (patch_name, date_time_run)
        VALUES ('DSMDB_Patch4', now());
        -- (CHANGE PATCH NUMBER ABOVE)

    END IF;

END //
DELIMITER ;

DELIMITER //
CREATE PROCEDURE CreateValueSetsTables()

		BEGIN
			-- (ADD WHAT YOU WANT TO DO FOR YOUR PATCH PROCEDURE HERE)
			CREATE TABLE IF NOT EXISTS `value_sets`
		(
		   uuid    VARCHAR(36)
					 CHARACTER SET latin1
					 COLLATE latin1_swedish_ci
					 NOT NULL,
		   name    VARCHAR(255)
					 CHARACTER SET latin1
					 COLLATE latin1_swedish_ci
					 NOT NULL,
		   UNIQUE KEY `name_UNIQUE`(name),
		   PRIMARY KEY(uuid),
		   UNIQUE KEY `uuid_UNIQUE`(uuid)
		)
		ENGINE INNODB
		COLLATE 'latin1_swedish_ci'
		ROW_FORMAT DEFAULT;

		CREATE TABLE data_sharing_manager.value_sets_codes
		(
		   uuid                VARCHAR(36)
								 CHARACTER SET latin1
								 COLLATE latin1_swedish_ci
								 NOT NULL,
		   value_sets_uuid     VARCHAR(36)
								 CHARACTER SET latin1
								 COLLATE latin1_swedish_ci
								 NOT NULL,
		   read2_concept_id    VARCHAR(12) CHARACTER SET utf8 COLLATE utf8_bin NULL,
		   ctv3_concept_id     VARCHAR(12) CHARACTER SET utf8 COLLATE utf8_bin NULL,
		   sct_concept_id      VARCHAR(18)
								 CHARACTER SET latin1
								 COLLATE latin1_swedish_ci
								 NULL,
		   PRIMARY KEY(uuid, value_sets_uuid),
		   UNIQUE KEY `uuid_UNIQUE`(uuid)
		)
		ENGINE INNODB
		COLLATE 'latin1_swedish_ci'
		ROW_FORMAT DEFAULT;

END //
DELIMITER ;

